deck_description:
Oh yeah, it's degeneracy time, baby!

&nbsp;

So Altergeist and Guru are two pretty well-known control decks. I think anyone who's been to locals has probably run into one of these decks before, and probably has a few choice words for anyone who plays these decks. So how's about we mash them together and make everyone mad?

&nbsp;

The deck can brick, all decks do. But a good hand allows for you to play Guru at first, and then pop off with Altergeist during your opponent's turn. <strong>The perfect hand is: </strong>The Hidden City, Subterror Guru, Subterror Final Battle, Solemn Judgment, and Altergeist Multifaker. Even if you get Ash Blossomed, you can get Guru on the field with two set back row, and Hidden City. But again, that's a perfect hand.

Honestly, you're just looking to play one side of the deck, and drop the other side either during your opponent's turn or right when you're backed into a corner. The side deck is built in a way that should allow you to switch to either Guru Control or Altergeist Control for games 2 and 3.
